import { Card } from './components/Card'
import { Footer } from './components/Footer';
import { Header } from './components/Header';
export function App() {
  return (
    <>
      <Header />
      <div className="App">
        <Card
          id={1}
          paragraph='Typescript'
          details='TS para frontend e backend'
        />
        <Card
          id={2}
          paragraph='HTML'
          details='HTML para front' />
        <Card
          id={3}
          paragraph='SQL'
          details='SQL para DB'
        />
      </div>
      <Footer />
    </>
  );
}

export default App;
